@Test
    public void isInAtRange() {

        byte[] letters = { 'a', 'b', 'c', 'd' };


        assertFalse(
                in( 'a', 1, 2, letters )
        );

        assertTrue(
                in( 'c', 1, 3, letters )
        );

    }

